### YamlMime:PythonClass
uid: azure.mgmt.web.v2019_08_01.models.EndpointDetail
name: EndpointDetail
fullName: azure.mgmt.web.v2019_08_01.models.EndpointDetail
module: azure.mgmt.web.v2019_08_01.models
inheritances:
- msrest.serialization.Model
summary: Current TCP connectivity information from the App Service Environment to
  a single endpoint.
constructor:
  syntax: 'EndpointDetail(*, ip_address: Optional[str] = None, port: Optional[int]
    = None, latency: Optional[float] = None, is_accessible: Optional[bool] = None,
    **kwargs)'
  parameters:
  - name: ip_address
    description: An IP Address that Domain Name currently resolves to.
    types:
    - '[str](https://docs.python.org/3.6/library/stdtypes.html#str)'
  - name: port
    description: The port an endpoint is connected to.
    types:
    - '[int](https://docs.python.org/3.6/library/functions.html#int)'
  - name: latency
    description: 'The time in milliseconds it takes for a TCP connection to be created
      from the

      App Service Environment to this IpAddress at this Port.'
    types:
    - '[float](https://docs.python.org/3.6/library/functions.html#float)'
  - name: is_accessible
    description: 'Whether it is possible to create a TCP connection from the App Service

      Environment to this IpAddress at this Port.'
    types:
    - '[bool](https://docs.python.org/3.6/library/functions.html#bool)'
